import React, { Component } from 'react'

export default class Dogs extends Component {
    render() {

        const { dogs, adopt, user, front, reset } = this.props
        return (
            <>
                <h2>Dog</h2>
                <img className="picture" src={dogs.imageURL} alt="dog img"></img>
                <p>Name: {dogs.name}</p>
                <p>Age: {dogs.age}</p>
                <p>Breed: {dogs.breed}</p>
                <p>Gender: {dogs.gender}</p>
                <p>Story: {dogs.story}</p>
                <button disabled={user !== front} onClick={adopt, reset}>ADOPT</button>
            </>
        )
    }
}
